#include <bits/stdc++.h>

using namespace std;

int commonChild(string s1, string s2) {

    int  m = s1.length();
    int n = s2.length();
    vector<vector<int>> cmnChild(m+1);
    for (int i = 0; i <= m; i++) {
        cmnChild[i] = vector<int>(n+1);
        for (int j = 0; j <= n; j++)
            cmnChild[i][j] = 0;
    }

    for(int i = 1; i <= m; i++){
        for(int j = 1; j <= n; j++){
            if(s1[i-1] == s2[j-1]){
                cmnChild[i][j] = cmnChild[i-1][j-1] + 1;
            } else{
                cmnChild[i][j] =   max(cmnChild[i-1][j],cmnChild[i][j-1]);
            }
        }
    }

    return cmnChild[m][n];
}

int main()
{
    string s1 = "";
    string s2 = "";
    cout<<commonChild(s1, s2);

    return 0;
}
